import React from "react";
import Grid from '@material-ui/core/Grid';
import UserName from "./UserName";
import '../../ProfilePage.css'

export default class ProfileData extends React.Component {
    constructor() {
        super();
        this.state = {
                id: 1,
                uploads: [
                    'https://www.youtube.com/watch?v=apJNCcq5s6s',
                    'https://www.youtube.com/watch?v=XvvYbJmA1cQ',
                    'https://www.youtube.com/watch?v=O1Qh7j1yD8Y',
                    'https://www.youtube.com/watch?v=y3W9Mn4beVs',
                    'https://www.youtube.com/watch?v=g4wbPoWvsdo&t=69s',
                    'https://www.youtube.com/watch?v=Eb5dsG7L7lo'
                ]
        }

    }

    render() {
        return (
            <div className={'uploadsContainer'}>
            </div>
        )
    }
};
